import React from 'react';
import './ViewWorkout.css';

function ViewWorkout() {
    const workout = {
        title: "My Workout",
        exercises: [
            {
                name: "Bench Press",
                sets: [
                    { reps: 10, weight: 100 },
                    { reps: 8, weight: 120 }
                ]
            },
            {
                name: "Squat",
                sets: [
                    { reps: 8, weight: 150 },
                    { reps: 6, weight: 170 }
                ]
            }
        ]
    };

    return (
        <div className="display-container">
            <h1 className="workout-title">{workout.title}</h1>
            {workout.exercises.map((exercise, index) => (
                <div key={index} className="exercise-display">
                    <h2 className="exercise-name">{exercise.name}</h2>
                    <table className="table">
                        <thead>
                            <tr>
                                <th>Set</th>
                                <th>Reps</th>
                                <th>Weight</th>
                            </tr>
                        </thead>
                        <tbody>
                            {exercise.sets.map((set, idx) => (
                                <tr key={idx}>
                                    <td>{idx + 1}</td>
                                    <td>{set.reps}</td>
                                    <td>{set.weight} kg</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            ))}
        </div>
    );
}

export default ViewWorkout;
